import React from 'react';
import ReactDOM from 'react-dom';

function MyInfo() {
    return (
        <div>
            <h1>I AM MOSTAFA HAZAREH</h1>
            <h4>My Skills are:</h4>
            <ul>
                <li>HTML</li>
                <li>CSS</li>
                <li>JavaScript</li>
                <li>ReactJS</li>
            </ul>
        </div>
    );
}

ReactDOM.render(<MyInfo />, document.getElementById('root')
);
